INSERT INTO investment_firms (id, name, description, website, stages, sectors, linkedin_url, created_at, folk_id, folk_workspace_id, folk_list_ids, folk_updated_at, source, updated_at, hq_location, industry, emails, phones, addresses, urls, folk_custom_fields, enrichment_status) VALUES ('4e505587-3136-4327-8df8-a3cf89dc32dd', 'Reus Capital Partners', 'Reus Capital Partners invests in Spanish digital companies with a global outlook, focusing on ventures led by committed founding teams possessing sector-specific talent or experience. The fund targets markets experiencing significant global growth, particularly those embracing digitalization. Investment decisions are based on initial metrics that demonstrate at least 4 months of traction and clear indications of exponential growth potential. Reus Capital Partners values capital efficiency, seeking ventures capable of generating substantial value with minimal investment, leveraging opportunities in internet and technology sectors. The fund emphasizes scalability through effective lead acquisition channels that drive high traffic and profitability. Since inception, Reus Capital Partners has invested over €10M in digital startups, facilitating three successful exits and establishing a robust network to support portfolio companies. The fund adopts an entrepreneur-friendly approach, preferring minimal board involvement and offering flexibility to entrepreneurs, enabling them to focus on business growth. Reus Capital Partners ensures rapid decision-making and close collaboration tailored to each entrepreneur''s needs, aligning their investment strategy with long-term company profitability and sustainable growth objectives.', 'https://www.reuscapitalpartners.com', '[]'::jsonb, '[]'::jsonb, 'https://www.linkedin.com/company/18935227/admin/', '2025-12-25T17:37:11.081Z', 'com_e96af218-5e1e-48b0-8d0e-7c6687c9364c', 'grp_62ed75ea-252a-4b2f-8f23-a9da0c20983d', '["grp_ae60bf78-cc82-478f-8b81-ecef406dc0dd","grp_62ed75ea-252a-4b2f-8f2