INSERT INTO investment_firms (id, name, description, website, stages, sectors, linkedin_url, created_at, folk_id, folk_workspace_id, folk_list_ids, folk_updated_at, source, updated_at, hq_location, industry, emails, phones, addresses, urls, folk_custom_fields, enrichment_status) VALUES ('23c6c5d9-0843-4ce1-9d38-4e25324f0f2b', 'Nunatak Capital', 'Based in Warsaw, Poland, Nunatak Capital is an early-growth and seed stage Venture Capital Fund focused on the European market. Nunatak Capital was created for startups that face complex challenges and constraints as they pursue their visionary projects. Our data science expertise and belief in entrepreneurship and innovation allow us to support ambitious teams in creating unique solutions. We invest in Teams that base the value of the startups they build on Data Science solutions. We are looking not only for startups that create new technologies, but also those that use existing technology to build the potential of their products. We invest wherever Data Science is used and where technology creates the unique value proposition. The startup development stage does not restrain us, but we are most willing to invest in companies that can prove that their solution is adjusted to market needs.', 'https://www.nunatakcapital.com/', '[]'::jsonb, '[]'::jsonb, 'https://www.linkedin.com/company/nunatak-capital/', '2025-12-25T17:37:11.158Z', 'com_8a9d4057-7c1d-4787-82b9-438dd2115069', 'grp_b6775cbc-29e9-4e71-b742-e0498331dee8', '["grp_ae60bf78-cc82-478f-8b81-ecef406dc0dd","grp_b6775cbc-29e9-4e71-b742-e0498331dee8","grp_62ed75ea-252a-4b2f-8f23-a9da0c20983d"]'::jsonb, '2025-12-25T18:32:11.884Z', 'folk', '2025-12-25T17:37:11.158Z', 'Poland', 'Data Science, Technology', '[]'::jsonb, '[]'::jsonb, '[]'::jsonb, '["nunatakcapital.com"]'::jsonb, '{"Title":null,"Rounds":"Seed, Early-growth","Status":null,"Country":"Poland","Fund HQ":null,"VC Logo":null,"Website":"https://www.nunatakcapital.com/","Linkedin":"https://www.linkedin.com/company/nunata