INSERT INTO investment_firms (id, name, description, website, stages, sectors, linkedin_url, created_at, folk_id, folk_workspace_id, folk_list_ids, folk_updated_at, source, updated_at, hq_location, industry, emails, phones, addresses, urls, folk_custom_fields, enrichment_status) VALUES ('e865948c-0cd4-4808-b953-f5c748a66871', 'Zanichelli Venture', 'Zanichelli Venture is looking for nascent companies who are tilling daring ideas about education and technology and searching for pre-seed or seed funding to grow these ideas into products to empower anyone – from children and parents to adult, professional lifelong learners and their mentors and coaches – to learn and teach better. We will support and finance ideas with the potential to have a positive impact on our future through education at every stage of our life. We will respectfully, discreetly stand by the entrepreneurs believing in these ideas, from the beginnings and at least since that impact leaves its first dent. We care about each startup in our portfolio getting the full value a hundred years old education company like Zanichelli can offer, wherever our expertise can be a lodestar because of our history, our mission, our network, our resources; and we believe in getting out of the founders'' way otherwise, if we don''t add value. We care about financial returns and self-sustainability and about bringing collaboration opportunities, insights, innovative thinking and entrepreneurial energy back to our company digital products designers, editorial staff and IT, searching for mutual advantages. Only in the long term, as we and the founders build trust through intense collaboration and shared stakes, and after a startup fully spreads out its potential as a maturing company, we believe in searching together for possible paths to a deeper partnership.', 'https://www.zanichelliventure.it/', '[]'::jsonb, '[]'::jsonb, 'https://www.linkedin.com/in/enricopoli/', '2025-12-25T17:37:11.189Z', 'com_b5947492-2ec0-4e78-a5fe-0be65261e1dd', 'grp_b6775cbc-29e9-4e71-b742-e0498331dee8', '["grp_ae60bf78-cc82-478f-8b81-ecef406dc0dd","grp_b6775cbc-29e9-4e71-b742-e0498331dee8","grp_62ed75ea-252a-4b2f-8f23-a9da0c20983d"]'::jsonb, '2025-12-25T18:32:12.069Z', 'folk', '2025-12-25T17:37:11.189Z', 'Italy', 'education, technology', '[]'::jsonb, '[]'::jsonb, '[]'::jsonb, '["https://www.zanichelliventure.com"]'::jsonb, '{"Title":null,"Rounds":"Pre-Seed, Seed","Status":null,"Country":"Italy","Fund HQ":null,"VC Logo":null,"Website":"https://www.zanichelliventure.it/","Linkedin":"https://www.linkedin.com/in/enricopoli/","Country 1":"Italy","Country 2":null,"Last Name":null,"First Name":null,"HQ Location":"Italy","Funding Stage":"Pre-Seed / Seed, Series A/B","Investor Type":"VC Firm","Investor State":null,"Portfolio Link":null,"Investment Size":"Pre-Seed, Seed","Investor''s Country":null,"Recent Investments":null,"Typical Investment":"€100k-€1.5M","Person Linkedin Url":null,"Num Lead Investments":null,"Partners'' LinkedIn Profile":null,"Total Number of Investments":null,"Partners'' LinkedIn Profile (2)":null,"Partners'' LinkedIn Profile (3)":null}'::jsonb, 'not_enriched') ON CONFLICT (id) DO UPDATE SET name = EXCLUDED.name, description = EXCLUDED.description, website = EXCLUDED.website, stages = EXCLUDED.stages, sectors = EXCLUDED.sectors, linkedin_url = EXCLUDED.linkedin_url, created_at = EXCLUDED.created_at, folk_id = EXCLUDED.folk_id, folk_workspace_id = EXCLUDED.folk_workspace_id, folk_list_ids = EXCLUDED.folk_list_ids, folk_updated_at = EXCLUDED.folk_updated_at, source = EXCLUDED.source, updated_at = EXCLUDED.updated_at, hq_location = EXCLUDED.hq_location, industry = EXCLUDED.industry, emails = EXCLUDED.emails, phones = EXCLUDED.phones, addresses = EXCLUDED.addresses, urls = EXCLUDED.urls, folk_custom_fields = EXCLUDED.folk_custom_fields, enrichment_status = EXCLUDED.enrichment_status;
