INSERT INTO investment_firms (id, name, description, website, stages, sectors, linkedin_url, created_at, folk_id, folk_workspace_id, folk_list_ids, folk_updated_at, source, updated_at, hq_location, industry, emails, phones, addresses, urls, folk_custom_fields, enrichment_status) VALUES ('0ccffec1-3bc4-4c28-b7aa-fb78920a0649', 'DeepTech Ventures', 'DeepTech Ventures is here to close the gap between the promise of Web3 and a reality where users can finally call the internet ''ours to own.'' DeepTech Ventures is here to close the gap between the promise of Web3, the third generation of the internet, and a reality where users can finally call the internet ''ours to own.'' The Web2 of today is slowly unravelling. This evolution from a privately owned internet of data hoarding platforms, to a world where people can be in control of their data, identity, and destiny, is a huge opportunity. Entire billion-dollar industries - from finance, gaming, art, and more - are being transformed. As investment pioneers, DeepTech Ventures is giving an intrepid community the resources to become an established industry with the power to change the world. For Web3 to truly come alive, its layered and fragmented infrastructure needs reinforcing and fusing together. Imagine information that can be stored, accessed, and shared between tiers, free from the prying eyes of profiteering platforms. For the architects and builders of the internet of tomorrow this is a playground of infinite programming possibility.', 'https://www.deeptechventures.io/', '[]'::jsonb, '[]'::jsonb, 'https://www.linkedin.com/company/deeptech-ventures/', '2025-12-25T17:37:11.401Z', 'com_b20f7f70-f9a8-47db-b6cb-71624f7dadb2', 'grp_b6775cbc-29e9-4e71-b742-e0498331dee8', '["grp_ae60bf78-cc82-478f-8b81-ecef406dc0dd","grp_b6775cbc-29e9-4e71-b742-e0498331dee8","grp_62ed75ea-252a-4b2f-8f23-a9da0c20983d"]'::jsonb, '2025-12-25T18:32:12.858Z', 'folk', '2025-12-25T17:37:11.401Z', 'Switzerland', 'Web 3.0, Distributed Ledger Technology, Deeptech', '[]'::jsonb, '[]'::jsonb, '[]'::jsonb, '["https://www.deeptechventures.com"]'::jsonb, '{"Title":null,"Rounds":"Pre-Seed, Seed, Series A, Series B","Status":null,"Country":"Switzerland","Fund HQ":null,"VC Logo":null,"Website":"https://www.deeptechventures.io/","Linkedin":"https://www.linkedin.com/company/deeptech-ventures/","Country 1":"Switzerland","Country 2":null,"Last Name":null,"First Name":null,"HQ Location":"Switzerland","Funding Stage":"Pre-Seed / Seed","Investor Type":"VC Firm","Investor State":null,"Portfolio Link":"https://www.linkedin.com/company/deeptech-ventures","Investment Size":"Not specified","Investor''s Country":null,"Recent Investments":null,"Typical Investment":"€100k-€1.5M","Person Linkedin Url":null,"Num Lead Investments":null,"Partners'' LinkedIn Profile":null,"Total Number of Investments":null,"Partners'' LinkedIn Profile (2)":null,"Partners'' LinkedIn Profile (3)":null}'::jsonb, 'not_enriched') ON CONFLICT (id) DO UPDATE SET name = EXCLUDED.name, description = EXCLUDED.description, website = EXCLUDED.website, stages = EXCLUDED.stages, sectors = EXCLUDED.sectors, linkedin_url = EXCLUDED.linkedin_url, created_at = EXCLUDED.created_at, folk_id = EXCLUDED.folk_id, folk_workspace_id = EXCLUDED.folk_workspace_id, folk_list_ids = EXCLUDED.folk_list_ids, folk_updated_at = EXCLUDED.folk_updated_at, source = EXCLUDED.source, updated_at = EXCLUDED.updated_at, hq_location = EXCLUDED.hq_location, industry = EXCLUDED.industry, emails = EXCLUDED.emails, phones = EXCLUDED.phones, addresses = EXCLUDED.addresses, urls = EXCLUDED.urls, folk_custom_fields = EXCLUDED.folk_custom_fields, enrichment_status = EXCLUDED.enrichment_status;
