INSERT INTO investment_firms (id, name, description, website, stages, sectors, linkedin_url, created_at, folk_id, folk_workspace_id, folk_list_ids, folk_updated_at, source, updated_at, hq_location, industry, emails, phones, addresses, urls, folk_custom_fields, enrichment_status) VALUES ('255c1b76-f78d-4503-9ae5-6c12ec2c7350', 'NextGen Ventures', 'NextGen Ventures is a venture capital firm based in the Netherlands, specializing in early-stage investments in innovative technology startups. Founded with a focus on supporting ambitious entrepreneurs, NextGen Ventures seeks to back companies with the potential to disrupt their industries and achieve substantial growth. The firm''s investment strategy centers around sectors such as software, fintech, healthtech, artificial intelligence, and other emerging technologies. NextGen Ventures provides seed and early-stage funding to startups, aiming to help them scale their businesses and bring innovative solutions to market. Beyond financial support, NextGen Ventures offers strategic guidance and operational expertise to its portfolio companies. This includes assistance with business development, market expansion, and accessing additional rounds of funding. The firm also leverages its network of industry connections and partners to create opportunities for growth and collaboration. NextGen Ventures is known for its hands-on approach and commitment to partnering with visionary founders. They aim to build long-term relationships and support startups through various stages of growth, from initial concept development to scaling into successful enterprises.', 'https://nextgenventures.nl/', '[]'::jsonb, '[]'::jsonb, 'https://www.linkedin.com/company/nextgen-ventures/', '2025-12-25T17:37:06.667Z', 'com_0dca46f2-2c2a-436c-b161-804611db7db8', 'grp_dbc35f0d-7ac7-4315-9d45-ec8a415ceaba', '["grp_dbc35f0d-7ac7-4315-9d45-ec8a415ceaba","grp_62ed75ea-252a-4b2f-8f23-a9da0c20983d"]'::jsonb, '2025-12-25T18:26:49.387Z', 'folk', '2025-12-25T18:26:4